-- Table structure for `rva_fe_list`
-- ----------------------------
DROP TABLE IF EXISTS `rva_fe_list`;
CREATE TABLE `rva_fe_list` (
  `id` varchar(64) NOT NULL COMMENT 'ID',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `mode` smallint(6) DEFAULT '1' COMMENT '排版模式（1-大图 2-左图 3-右图 4-无图 5-聊天群 6-聊天）',
  `force_mode` varchar(1) DEFAULT 'Y' COMMENT '强制模式，为Y时，忽略列表项的mode，采用列表的mode',
  `obj_id` varchar(64) NOT NULL COMMENT '主对象ID，此处为表名',
  `obj_favorites_ids` text COMMENT '收藏等对象ID，JSON对象格式，key为rva_objectfavorite.type的值，value为表名，用于存放收藏、点赞等数据',
  `obj_comments_id` varchar(64) DEFAULT NULL COMMENT '评论对象ID，用于存放评论数据，此处为表名',
  `load_where` varchar(500) DEFAULT NULL COMMENT '查询条件，velocity模板，解析后为sql脚本where语句，作为列表查询条件的一部分',
  `rows_init` smallint(6) DEFAULT '10' COMMENT '初始行数，列表初始显示行数，0表示无限制，不分页',
  `rows_update` smallint(6) DEFAULT '10' COMMENT '更新行数，每次上划下拉更新的行数',
  `show_title` varchar(1) DEFAULT 'Y' COMMENT '显示标题，针对列表项',
  `show_excerpt` varchar(1) DEFAULT 'Y' COMMENT '显示摘要，针对列表项',
  `show_avatar_count` smallint(6) DEFAULT '1' COMMENT '显示图片数，不大于0表示不显示',
  `show_extras_count` smallint(6) DEFAULT '2' COMMENT '显示额外数量，针对列表项，0表示不显示',
  `show_button_count` smallint(6) DEFAULT '3' COMMENT '显示按钮数量，针对列表项，0表示不显示',
  `prop_name_mode` varchar(64) DEFAULT NULL COMMENT '排版模式属性名，指定obj_id对应表的某个字段，用于存储排版模式',
  `prop_name_disabled` varchar(64) DEFAULT NULL COMMENT '禁用属性名，指定obj_id对应表的某个字段，用于禁用信息',
  `prop_name_category` varchar(64) DEFAULT NULL COMMENT '分类属性名，指定obj_id对应表的某个字段，关联obj_categories_id主键，用于存储分类数据',
  `prop_name_group` varchar(64) DEFAULT NULL COMMENT '分组属性名，指定obj_id对应表的某个字段，用于存储分组信息，实现动态分组',
  `dict_category` varchar(64) DEFAULT NULL COMMENT '分类字典，prop_name_category的值对应的数据字典',
  `dict_group` varchar(64) DEFAULT NULL COMMENT '分组字典，prop_name_group的值或者rva_fe_list_item.group_value对应的数据字典',
  `data` text COMMENT '其他数据',
  `rva_update_time_` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '时间戳',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='列表';

