-- ----------------------------
-- Table structure for `rva_fe_list_item`
-- ----------------------------
DROP TABLE IF EXISTS `rva_fe_list_item`;
CREATE TABLE `rva_fe_list_item` (
  `id` varchar(64) NOT NULL COMMENT 'ID',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `position` varchar(30) DEFAULT NULL COMMENT '位置（title-标题 excerpt-摘要 extras-额外字段 avatar-图片 buttons-操作按钮 time-时间文本 badge-badge文本 right-右侧文本）',
  `list_id` varchar(64) NOT NULL COMMENT '列表ID，rva_fe_list.id',
  `prop_id` varchar(64) DEFAULT NULL COMMENT '属性ID，rva_property.id',
  `idx` smallint(6) DEFAULT '0' COMMENT '排序',
  `icon` varchar(500) DEFAULT NULL COMMENT '图标',
  `text` varchar(500) DEFAULT NULL COMMENT '文本内容，为velocity模板，解析后的内容用于显示，如果为空，则显示name的值',
  `order_index` smallint(6) DEFAULT '-1' COMMENT '排序索引',
  `order_type` varchar(10) DEFAULT NULL COMMENT '排序类型，DESC/ASC',
  `group_value` varchar(100) DEFAULT NULL COMMENT '分组值，用于对列表项进行静态分组，关联rva_fe_list.group_dict',
  `action_type` varchar(30) DEFAULT NULL COMMENT '位置（dialog ajax navigateTo switchTab redirectTo reLaunch toogleFavorite delete share）',
  `action_params` text COMMENT '动作参数，JSON格式，action_type=dialog时，参数中应该包含viewId，指明关联的表单视图；action_type=ajax/navigateTo/switchTab/redirectTo/reLaunch时，参数中应该包含url',
  `dict` varchar(64) DEFAULT NULL COMMENT '数据字典',
  `number_scale` smallint(6) DEFAULT '0' COMMENT '小数位',
  `show_arrow` varchar(1) DEFAULT 'Y' COMMENT '显示箭头',
  `switch_url` varchar(200) DEFAULT NULL COMMENT 'Switch地址，有值时显示Switch控件，点击ajax请求',
  `data` text COMMENT '其他数据',
  `rva_update_time_` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '时间戳',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='列表项';

